import React, { useState, FormEvent, ChangeEvent } from "react";
import { Button, Form } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import { RootState, resetStoreAction } from "../../redux/store/store";
import registerFetch from "../../redux/actions/registerAction";

interface RegisterFormValues {
  username: string;
  email: string;
  password: string;
  firstname: string;
  lastname: string;
  stageName: string;
  professions: string[];
  bio?: string;
  city?: string;
  state?: string;
  skills?: string[];
}

const RegisterForm: React.FC = () => {
  const dispatch = useDispatch();
  const register = useSelector((state: RootState) => state.register);
  const [formValues, setFormValues] = useState<RegisterFormValues>({
    username: "",
    email: "",
    password: "",
    firstname: "",
    lastname: "",
    stageName: "",
    professions: [],
    bio: "",
    city: "",
    state: "",
    skills: [],
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormValues((prevValues) => ({
      ...prevValues,
      [name]: value,
    }));
  };

  const handleProfessionsChange = (e: ChangeEvent<HTMLInputElement>) => {
    const { name, checked } = e.target;
    setFormValues((prevValues) => {
      const updatedProfessions = checked
        ? [...prevValues.professions, name]
        : prevValues.professions.filter((profession) => profession !== name);
      return {
        ...prevValues,
        professions: updatedProfessions,
      };
    });
  };

  const handleSubmit = (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    dispatch(registerFetch(formValues));
  };

  const handleReset = () => {
    setFormValues({
      username: "",
      email: "",
      password: "",
      firstname: "",
      lastname: "",
      stageName: "",
      professions: [],
    });
  };

  return (
    <Form onSubmit={handleSubmit} onReset={handleReset}>
      <Form.Group controlId="formUsername">
        <Form.Label>Username</Form.Label>
        <Form.Control
          type="text"
          name="username"
          placeholder="Enter username"
          value={formValues.username}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formEmail">
        <Form.Label>Email</Form.Label>
        <Form.Control
          type="email"
          name="email"
          placeholder="Enter email"
          value={formValues.email}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formPassword">
        <Form.Label>Password</Form.Label>
        <Form.Control
          type="password"
          name="password"
          placeholder="Enter password"
          value={formValues.password}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formFirstname">
        <Form.Label>First Name</Form.Label>
        <Form.Control
          type="text"
          name="firstname"
          placeholder="Enter first name"
          value={formValues.firstname}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formLastname">
        <Form.Label>Last Name</Form.Label>
        <Form.Control
          type="text"
          name="lastname"
          placeholder="Enter last name"
          value={formValues.lastname}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formStageName">
        <Form.Label>Stage Name</Form.Label>
        <Form.Control
          type="text"
          name="stageName"
          placeholder="Enter stage name"
          value={formValues.stageName}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formProfessions">
        <Form.Label>Professions</Form.Label>
        <Form.Check
          type="checkbox"
          name="profession1"
          label="Profession 1"
          checked={formValues.professions.includes("profession1")}
          onChange={handleProfessionsChange}
        />
        <Form.Check
          type="checkbox"
          name="profession2"
          label="Profession 2"
          checked={formValues.professions.includes("profession2")}
          onChange={handleProfessionsChange}
        />
      </Form.Group>

      <Form.Group controlId="formBio">
        <Form.Label>Bio</Form.Label>
        <Form.Control
          as="textarea"
          rows={3}
          name="bio"
          placeholder="Enter bio"
          value={formValues.bio || ""}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formCity">
        <Form.Label>City</Form.Label>
        <Form.Control
          type="text"
          name="city"
          placeholder="Enter city"
          value={formValues.city || ""}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formState">
        <Form.Label>State</Form.Label>
        <Form.Control
          type="text"
          name="state"
          placeholder="Enter state"
          value={formValues.state || ""}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formSkills">
        <Form.Label>Skills</Form.Label>
        <Form.Control
          type="text"
          name="skills"
          placeholder="Enter skills (comma-separated)"
          value={formValues.skills?.join(", ") || ""}
          onChange={handleChange}
        />
      </Form.Group>

      <Button variant="primary" type="submit">
        Register
      </Button>
      <Button variant="secondary" type="reset">
        Reset
      </Button>
      {register.error && <p className="text-danger">{register.error}</p>}
    </Form>
  );
};

export default RegisterForm;
